function min_x = min_area_diff(side)
    A = side^2; % Area of the original square
    x = 0:side; % Range of x values to check
    min_x = inf; % Initialize minimum x value

    for i = 1:length(x)
        new_A = (side + x(i))^2; % New area of square A
        new_B = (side - x(i))^2; % New area of square B
        diff = new_A - new_B; % Difference in areas

        if diff >= A % Check if the difference is greater than the original area
            min_x = min(min_x, x(i)); % Update minimum x value
        end
    end
