3&=a(-1-1)^2+k \Rightarrow 3=4a+k\\
-2&=a(2-1)^2+k \Rightarrow -2=a+k
\end{align*} Subtracting the second equation from the first yields $5=3a$, so $a=5/3$. Plugging this value into the second equation to solve for $k$, we find that $k=-11/3$. So the equation of the parabola is $y=\frac{5}{3}(x-1)^2-\frac{11}{3}$. To find the zeros of the parabola, we set $y=0$ and solve for $x$: \begin{align*}
0&=\frac{5}{3}(x-1)^2-\frac{11}{3}\\
\frac{11}{3}&=\frac{5}{3}(x-1)^2 &\\
\frac{11}{5}&=(x-1)^2\\
x &= \pm\sqrt{\frac{11}{5}}+1
\end{align*}

