rationale:
The midpoints of the diagonals of a square coincide, so the midpoint of the line segment joining (7,9) and (10,2) is the same as the midpoint of the line segment joining the other two vertices of the square.  The average of the $y$-coordinates of (7,9) and (10,2) is the $y$-coordinate of their midpoint, which in turn is also equal to the average of the $y$-coordinates of the missing vertices.  Therefore, the average of the $y$-coordinates of (7,9) and (10,2) is equal to the average of the $y$-coordinates of the two missing vertices.  Since the sum is twice the average, the sum of the $y$-coordinates of the missing vertices is the same as that of the given vertices: $9+2=$.

[asy]
unitsize(0.5 cm);

pair A, B, C, D, O;

A = (7,9);
C = (10,2);
O = (A + C)/2;
B = rotate(90,O)*(A);
D = rotate(90,O)*(C);

draw(A--B--C--D--cycle);
draw(A--C);
draw(B--D);

dot("$(7,9)$", A, N);
dot("$(10,2)$", C, S);
dot(O);
[/asy]

