function roots_and_count(a)
    eq = @(x) x.^2 + a - a*x;
    roots = roots(eq);
    if length(roots) == 1
        return roots(1), 1;
    else
        return [];
    end
end

for a = -10:0.01:10
    [root, count] = roots_and_count(a);
    if count > 0
        fprintf('a = %f, root = %f\n', a, root);
    end
end
```

